var app = angular.module("emirates", ['angucomplete-alt'], function(){

});

app.controller("QuestionareCtrl", function($scope, $http){

    $scope.step1 = null;
	$scope.step2 = null;
	$scope.step3 = null;
	$scope.step4 = null;
	$scope.step5 = null;
	$scope.step6 = null;
	
	$scope.questionary = {}

	$scope.answer = function(step, model){

		 switch (step) {
            case 'step1':
            Object.keys(model).forEach(function (key) {
				 if(typeof model[key] === 'undefined' || typeof model[key] === ''){
				    delete model[key];
				  }
				});
                  $scope.step1 = model;
                break;
            case 'step2':
                Object.keys(model).forEach(function (key) {
				 if(typeof model[key] === 'undefined' || typeof model[key] === ''){
				    delete model[key];
				  }
				});
                  $scope.step2 = model;
                break;
			case 'step3':
                Object.keys(model).forEach(function (key) {
				 if(typeof model[key] === 'undefined' || typeof model[key] === ''){
				    delete model[key];
				  }
				});
                  $scope.step3 = model;
                break;
            case 'step4':
                Object.keys(model).forEach(function (key) {
				 if(typeof model[key] === 'undefined'|| typeof model[key] === ''){
				    delete model[key];
				  }
				});
                  $scope.step4 = model;
                break;
            case 'step5':
                Object.keys(model).forEach(function (key) {
				 if(typeof model[key] === 'undefined' || typeof model[key] === ''){
				    delete model[key];
				  }
				});
                  $scope.step5 = model;
                break;

            default:

        }
        
	}

	$scope.submitButton = function(contact){

		$scope.questionary = {
	   		step1: $scope.step1,
	   		step2: $scope.step2,
	   		step3: $scope.step3,
	   		step4: $scope.step4,
	   		step5: $scope.step5,
	   		step6: $scope.step6,
	   		contact:contact
   		};

	$http({
		method: 'POST', //CHANGE THIS FROM GET TO POST
		url: 'mail_questionary.php?f=questionary',
		params:  $scope.questionary, //USE PROPER JAVASRIPT OBJECTS
		
		headers: {
		    'Content-Type': 'application/x-www-form-urlencoded'
		}

		}) .then(function (response) {
            	$.notify(response.data, "success");
        })
	}
});

